var $bm_rt;
var C = thisComp.layer('C_H_Fot');
var goal = C.effect('Goal H_Fot')(1);
var result = sum(value, C.rotation);
if (goal == 1) {
    var layer = thisLayer;
    while (layer.hasParent) {
        layer = layer.parent;
        result = sub(result, layer.rotation);
    }
}
$bm_rt = result;

var $bm_rt;
var layer1, layer2, controller, zeroName, zero, ctrlEffect, FK, IKFK, cw;
layer1 = thisComp.layer('H_Hofte');
layer2 = thisComp.layer('H_Kne');
controller = thisComp.layer('C_H_Fot');
zeroName = 'IK_zero H_Kne';
zero = thisComp.layer(zeroName);
ctrlEffect = controller.effect('IK H_Kne');
FK = ctrlEffect(5);
IKFK = ctrlEffect(3) == 0;
cw = ctrlEffect(1) == 1;
function getWorldPos(L) {
    return L.toWorld(L.anchorPoint);
}
function ik() {
    var A, B, C, E, a, b, c, x, alpha, y, gamma, result, V1, adj1, V2, adj2, IK;
    A = getWorldPos(layer1);
    B = getWorldPos(layer2);
    C = getWorldPos(zero);
    E = getWorldPos(controller);
    a = length(B, C);
    b = length(E, A);
    c = length(A, B);
    x = div(sub(sum(mul(b, b), mul(c, c)), mul(a, a)), mul(2, b));
    alpha = Math.acos(clamp(div(x, c), -1, 1));
    y = sub(b, x);
    gamma = Math.acos(clamp(div(y, a), -1, 1));
    result = mul(cw ? 1 : -1, radiansToDegrees(sum(gamma, alpha)));
    V1 = sub(B, A);
    adj1 = radiansToDegrees(Math.atan2(V1[1], V1[0]));
    V2 = sub(C, B);
    adj2 = radiansToDegrees(Math.atan2(V2[1], V2[0]));
    IK = sum(sub(sum(result, adj1), adj2), value);
    return IK;
}
$bm_rt = IKFK ? ik() : FK;

