var $bm_rt;
var layer1, controller, ctrlEffect, stretch, auto, IK, shrinkVal, dist1, dist2, IKLength, IKStretched, boneStretch, proportion, posC, posR, distC, shrinkMax, shrink, shrink, boneStretch, boneStretch, boneStretch, coef;
layer1 = thisComp.layer('H_Hofte');
controller = thisComp.layer('C_H_Fot');
ctrlEffect = controller.effect('IK H_Kne');
stretch = ctrlEffect(9);
auto = ctrlEffect(8) == 1;
IK = ctrlEffect(3) == 0;
shrinkVal = div(ctrlEffect(10), 100);
function getWorldPos(L) {
    return L.toWorld(L.anchorPoint);
}
dist1 = length([
    449,
    331,
    0
], [
    657,
    377,
    0
]);
dist2 = length([
    657,
    377,
    0
], [
    796,
    501,
    0
]);
IKLength = sum(dist1, dist2);
IKStretched = sum(IKLength, stretch);
boneStretch = 0;
proportion = div(dist1, IKLength);
posC = getWorldPos(controller);
posR = getWorldPos(layer1);
distC = length(posC, posR);
shrinkMax = mul(IKLength, shrinkVal);
shrink = 0;
if (distC < IKStretched && IK)
    shrink = sub(1, div(distC, IKStretched));
boneStretch -= mul(easeOut(shrink, 0, shrinkMax), proportion);
if (distC > IKStretched && auto && IK)
    boneStretch += mul(sub(distC, IKLength), proportion);
else
    boneStretch += mul(stretch, proportion);
coef = 1;
dist1 != 0 ? coef = div(sum(dist1, boneStretch), dist1) : coef = 1;
$bm_rt = sum(mul(sub([
    657,
    377,
    0
], [
    449,
    331,
    0
]), coef), [
    449,
    331,
    0
]);

